import React, { Component } from 'react';

class Builder extends Component {

  constructor(props) {
    super(props);

    this.state = {
      menus: [
        {
          title: "LA County Fair",
          photo: "../event.png"
        }
      ],
      items: [
        {
          title: "burger",
          photo: "../burritobowl.jpg"
        }
      ]
    };
  }

  render() {
    return (
      <div className="App">

        <div id="toolbar">
          <span className="toolbarItem">
            + Menu
            </span>|
            <span className="toolbarItem">
            + Item
            </span>
        </div>

        <div id="content">
          <div id="menus">
            <div className="menu">
              <img alt="menu item" src="../menu.jpg" />
              <p className="menuTitle">menu title</p>
            </div>
          </div>

          <div className="section">
            <p className="sectionTitle">menu title</p>
            <div className="rule"></div>
            <div className="items">
              <div className="item">
                <img alt="menu item" src="../burritobowl.jpg" />
                <p className="itemTitle">item title</p>
              </div>
            </div>
          </div>

        </div>

      </div >
    )
  };
}

export default Builder;
